const RobotoCondensed300 = `@font-face { font-family: 'Roboto Condensed'; font-style: normal; font-weight: 300; src: local('Roboto Condensed Light'), local('RobotoCondensed-Light'), url('data:font/woff2;base64,') format('woff2'); }`;
const RobotoCondensed300italic = `@font-face { font-family: 'Roboto Condensed'; font-style: italic; font-weight: 300; src: local('Roboto Condensed Light Italic'), local('RobotoCondensed-LightItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const RobotoCondensedRegular = `@font-face { font-family: 'Roboto Condensed'; font-style: normal; font-weight: 400; src: local('Roboto Condensed'), local('RobotoCondensed-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
