const RobotoCondensed700 = `@font-face { font-family: 'Roboto Condensed'; font-style: normal; font-weight: 700; src: local('Roboto Condensed Bold'), local('RobotoCondensed-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
